window.bookSummaryJSON = "<p>Bethany Anne and those in the Etheric Empire&nbsp;have conquered the Aliens who would conquer Earth.&nbsp;</p> <p>However, there are a few that do not appreciate the new rules.</p> <p>Dealing with insurrectionists down on the planet, or with a large military rebellion coming from another system, Bethany Anne and team are ready and willing to give everyone a piece of their mind. Because there is one common attitude that runs in all of those who fight for the Etheric Empire.</p> <p>They will never surrender.</p>"; 
